import React from "react";
import ToDoList from "./ToDoList";


const App = () => {
    return (
        <>
            <div className="main_div">
                <br />
                <h1>To Do List</h1>
                <br />
                <div className="input_btn">
                    <input type="text" placeholder="Add Items" />
                    <button>+</button>
                </div>
                <ToDoList />
            </div>
        </>
    );
};

export default App;
